import React, { Component } from 'react';
import './App.css';
import {Layout, Header, Textfield, Drawer, Navigation, Content } from 'react-mdl';
import Main from './components/main';
import {Link} from 'react-router-dom';
import Footer from './components/footer';
class App extends Component {
  render(){
  return (
    <div className="demo-big-content">
    <Layout>
        <Header className="header-gradient" title="Portfolio" scroll>
            <Navigation>
                <Link className="navlink" to="/resume">Resume</Link>
                <Link className="navlink" to="/project">Project</Link>
                <Link className="navlink" to="/about">About</Link>
                <Link className="navlink" to="/contact">Contact</Link>
            </Navigation>
            <Textfield className= "search-field"
    onChange={() => {}}
    label="Expandable Input"
    expandable
    expandableIcon="search"
/>
             </Header>
        <Drawer title="Portfolio" className="drawerColor">
            <Navigation>
            <Link to="/resume">Resume</Link>
                <Link to="/project">Project</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </Navigation>
        </Drawer>

        <Content>
            <div className="page-content" />
            <Main/>
    <Footer/>

        </Content>
    </Layout>
</div>
  );
  }
}

export default App;
